import React, { useState } from 'react';
import axios from 'axios';


const ReportForm = ({ setReportId }) => {
  const [formData, setFormData] = useState({
    eventName: '',
    hostName: '',
    contactNo: '',
    email: '',
    date: '',
    invitedGuests: '',
    attendedGuests: '',
    totalCost: '',
    advancedAmount: '',
    pendingAmount: ''
  });
  const [message, setMessage] = useState({ text: '', type: '' });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/api/reports/save-report', formData);
      setReportId(response.data.reportId);
      setMessage({ text: 'Report saved successfully!', type: 'success' });
    } catch (error) {
      setMessage({ 
        text: error.response?.data?.error || 'Error saving report', 
        type: 'error' 
      });
    }
  };

  return (
    <div className="report-form-container">
      <h2>Create Event Report</h2>
      {message.text && (
        <div className={`message ${message.type}`}>{message.text}</div>
      )}
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Event Name</label>
          <input 
            type="text" 
            name="eventName" 
            value={formData.eventName} 
            onChange={handleChange} 
            required 
          />
        </div>

        <div className="form-group">
          <label>Host Name</label>
          <input 
            type="text" 
            name="hostName" 
            value={formData.hostName} 
            onChange={handleChange} 
            required 
          />
        </div>

        <div className="form-row">
          <div className="form-group">
            <label>Contact Number</label>
            <input 
              type="tel" 
              name="contactNo" 
              value={formData.contactNo} 
              onChange={handleChange} 
              required 
            />
          </div>

          <div className="form-group">
            <label>Email</label>
            <input 
              type="email" 
              name="email" 
              value={formData.email} 
              onChange={handleChange} 
              required 
            />
          </div>
        </div>

        <div className="form-group">
          <label>Event Date</label>
          <input 
            type="date" 
            name="date" 
            value={formData.date} 
            onChange={handleChange} 
            required 
          />
        </div>

        <div className="form-row">
          <div className="form-group">
            <label>Invited Guests</label>
            <input 
              type="number" 
              name="invitedGuests" 
              value={formData.invitedGuests} 
              onChange={handleChange} 
              required 
              min="0"
            />
          </div>

          <div className="form-group">
            <label>Attended Guests</label>
            <input 
              type="number" 
              name="attendedGuests" 
              value={formData.attendedGuests} 
              onChange={handleChange} 
              required 
              min="0"
            />
          </div>
        </div>

        <div className="form-row">
          <div className="form-group">
            <label>Total Cost ($)</label>
            <input 
              type="number" 
              name="totalCost" 
              value={formData.totalCost} 
              onChange={handleChange} 
              required 
              min="0"
              step="0.01"
            />
          </div>

          <div className="form-group">
            <label>Advanced Amount ($)</label>
            <input 
              type="number" 
              name="advancedAmount" 
              value={formData.advancedAmount} 
              onChange={handleChange} 
              required 
              min="0"
              step="0.01"
            />
          </div>

          <div className="form-group">
            <label>Pending Amount ($)</label>
            <input 
              type="number" 
              name="pendingAmount" 
              value={formData.pendingAmount} 
              onChange={handleChange} 
              required 
              min="0"
              step="0.01"
            />
          </div>
        </div>

        <button type="submit" className="submit-btn">Save Report</button>
      </form>
    </div>
  );
};

export default ReportForm;
